<script type="text/javascript">
$(".left-side").on('click',function(){
    console.log('left side');
    if(!($('li.active').is('.top-bar-tab li:first-child'))){    
        $('li.active').removeClass('active').prev().addClass('active');
        $('.tab-pane.active').removeClass('active in').prev().addClass('in active');
        $('.my-btn').addClass('btn-primary');
        $('li.active a').removeClass('btn-primary').prev().addClass('btn-default');    
    }   
});

$(".right-side").on('click',function(){
    console.log('right side');
    if(!($('li.active').is('.top-bar-tab li:last-child'))){
        $('li.active').next().addClass('active').prev().removeClass('active');
        $('.tab-pane.active').next().addClass('in active').prev().removeClass('active in');
        $('.my-btn').addClass('btn-primary');
        $('li.active a').removeClass('btn-primary').next().addClass('btn-default');    
    }   
});

$(".my-btn").on('click',function(){
    // console.log(this(class));
    $('.my-btn').addClass('btn-primary');
    $(this).removeClass('btn-primary').addClass('btn-default');

});


</script>
